import React, {useState} from 'react';

const Counter = () =>{
    const [num, setNum] = useState(0);

    const clickPlus = () =>{
        setNum(num + 1);
    }


    return(
        <div>
            
            <button onClick={clickPlus}>{num}+</button>
        </div>
    )
}

export default Counter;
